import { createTheme } from "@material-ui/core";
import { blue, grey } from "@material-ui/core/colors";

const theme =createTheme({
    palette:{
        primary:{
            main:grey[500]
        }
    },
    myNav:{
        backgroundColor:'#1B224A',
        color:'#C7DFC1'
    },
    mybutton:{
        backgroundColor:'#C7DFC1',
        color:'#1B224A',
        border:"1px solid black"
    }
})
export default theme
